(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0b16af"],{2083:function(e){e.exports=JSON.parse('{"title":"Food Tales: Cheese","header":"Whether it\'s Philyshy or Yumi, cheese seems to be their nemesis that drives them crazy. What did cheese ever do to them?","chat":[{"chat":[{"char":"Navigator:","dialogue":"Philyshy, what are you looking for?"},{"char":"Philyshy:","dialogue":"I remember there being a master console here?"},{"char":"Navigator:","dialogue":"Did you come to the bridge for it?"},{"char":"Philyshy:","dialogue":"Yes! Does the master console know where things are stored?"},{"char":"Philyshy:","dialogue":"But I don\'t know how to turn it on... It looks like a piano, why don\'t I play it?"},{"char":"Navigator:","dialogue":"Wait, Philyshy!"},{"char":"Philyshy:","dialogue":"Meow, don\'t be so loud! Why are you so surprised? You play it like this all the time!"},{"char":"Navigator:","dialogue":"Sorry, but that\'s not how you use the master console... Here, let me do it."},{"char":"Navigator:","dialogue":"But, really, what are you looking for?"},{"char":"Philyshy:","dialogue":"Dried fish, is there any dried fish? The ones that are tiny and not especially tough when you chew on them..."},{"char":"Navigator:","dialogue":"Dried fish? Let me think... There should be some, I remember Umbraton brought some over a few days ago..."},{"char":"Philyshy:","dialogue":"Where are they? Philyshy just happens to be hungry."},{"char":"Navigator:","dialogue":"(Just happens to be...? I don\'t think so. I don\'t think you are hungry, you are just insatiable...)"},{"char":"Navigator:","dialogue":"I think they are in a storage box in the warehouse. There are probably some left..."},{"char":"Philyshy:","dialogue":"Oh, I see, then I\'ll be off now!"},{"char":"Navigator:","dialogue":"She\'s in such a hurry. Must really be insatiable..."},{"char":"Navigator:","dialogue":"Wait, is she going to finish them all..."},{"char":"Navigator:","dialogue":"I remember Vice saying that those dried fish are important as a source of nutrition..."},{"char":"Navigator:","dialogue":"I need to go check on her..."},{"char":"Navigator:","dialogue":"Hmm... The storage box is open. Where\'s Philyshy?"},{"char":"Navigator:","dialogue":"There are still some dried fish in the fridge..."},{"char":"Navigator:","dialogue":"Why do I hear soft snoring? Where..."},{"char":"Navigator:","dialogue":"Ah, behind the storage box, it\'s..."},{"char":"Philyshy:","dialogue":"Purr... Purr..."},{"char":"Philyshy:","dialogue":"So much dried fish... I can\'t stuff down anymore..."},{"char":"Navigator:","dialogue":"Philyshy... She is even dreaming about dried fish... the drool..."},{"char":"Navigator:","dialogue":"Watching her sleeping gluttonously is making me hungry..."},{"char":"Navigator:","dialogue":"I remember that there\'s a cheese pudding in the fridge. I think Ms. Blanc made it, why don\'t I..."},{"char":"Navigator:","dialogue":"It\'s perfectly chilled... looks like there\'s a lot of cheese, but... there\'s no spoon..."},{"char":"Navigator:","dialogue":"Spoon..."},{"char":"Navigator:","dialogue":"Ah!"},{"char":"Navigator:","dialogue":"Philyshy?"},{"char":"Yumi:","dialogue":"Dried fish!"},{"char":"Navigator:","dialogue":"(Something\'s wrong with her...)"},{"char":"Yumi:","dialogue":"What a strange smell!"},{"char":"Navigator:","dialogue":"Did I wake you? I\'m sorry! Philyshy, I didn\'t mean to..."},{"char":"Navigator:","dialogue":"But you fell asleep in the warehouse... with dried fish in your mouth, so..."},{"char":"Yumi:","dialogue":"What are they?"},{"char":"Navigator:","dialogue":"This? You mean the fridge?"},{"char":"Yumi:","dialogue":"What\'s that thing inside the fridge?"},{"char":"Navigator:","dialogue":"Pudding..."},{"char":"Yumi:","dialogue":"Pudding... the smell makes me shudder... What is it made of?"},{"char":"Navigator:","dialogue":"It\'s... it\'s cheese..."},{"char":"Yumi:","dialogue":"Cheese!"},{"char":"Navigator:","dialogue":"Ahhh! Don\'t litter with your dried fish, Philyshy!"},{"char":"Yumi:","dialogue":"Cheese!"},{"char":"Navigator:","dialogue":"Miss, Miss Philyshy, stop jumping around!"},{"char":"Yumi:","dialogue":"Cheese!"},{"char":"Navigator:","dialogue":"Intel Chief! Intel Chief! Please calm down, don\'t grab my hair!"},{"char":"Yumi:","dialogue":"Cheese!!!!!"},{"char":"Navigator:","dialogue":"My Intel Chief! My Intel Chief! Don\'t lift the fridge! That\'s public property! And so are the things in it..."},{"char":"Yumi:","dialogue":"Cheese! You dare spill it on me!"},{"char":"Navigator:","dialogue":"Intel Chief?"},{"char":"Yumi:","dialogue":"It\'s dirty now and I\'ll never get the smell out! Darn it!"},{"char":"Navigator:","dialogue":"Philyshy..."},{"char":"Yumi:","dialogue":"You\'re wrong, it\'s not Philyshy, it\'s Yumi!"},{"char":"Navigator:","dialogue":"The pudding was spilled, but there are also carrots, beer, candy, and milk..."},{"char":"Yumi:","dialogue":"Pudding! What about cheese..."},{"char":"Navigator:","dialogue":"No cheese left... it\'s all on the floor..."},{"char":"Yumi:","dialogue":"On the floor?!"},{"char":"Yumi:","dialogue":"Ahhhhhhh!!!"},{"char":"Navigator:","dialogue":"Don\'t just jump all of a sudden and don\'t leap onto the beam, Intel Chief!"},{"char":"Navigator:","dialogue":"That ceiling lamp can\'t take that much weight!"},{"char":"Yumi:","dialogue":"Wipe it! Wipe that darn cheese off!"},{"char":"Navigator:","dialogue":"Right away..."},{"char":"Yumi:","dialogue":"I think the smell is gone..."},{"char":"Navigator:","dialogue":"Then, can you come down now, Intel Chief?"},{"char":"Navigator:","dialogue":"Don\'t sit on the fridge... It can\'t support..."},{"char":"Yumi:","dialogue":"I think there\'s still cheese here..."},{"char":"Navigator:","dialogue":"I\'ve already cleaned it all up..."},{"char":"Navigator:","dialogue":"Ah, Intel Chief, don\'t bounce on the fridge—"},{"char":"Navigator:","dialogue":"Actually, just sit on the fridge and stay there..."},{"char":"Yumi:","dialogue":"Hey, don\'t put that thing there anymore! Got it?"},{"char":"Navigator:","dialogue":"Got... got it."},{"char":"Yumi:","dialogue":"Both Philyshy and I hate it..."},{"char":"Navigator:","dialogue":"I don\'t think it\'s merely hate..."},{"char":"Yumi:","dialogue":"Yes, it\'s fear..."},{"char":"Navigator:","dialogue":"Fear... What? Why?"},{"char":"Navigator:","dialogue":"Chee... Ah no... that stuff doesn\'t poison you when you eat it, and it has no peculiar smell..."},{"char":"Yumi:","dialogue":"Too much... too much..."},{"char":"Navigator:","dialogue":"Too much?"},{"char":"Yumi:","dialogue":"Philyshy and I stumbled upon a ruin once where a lot of Eclipsites gathered..."},{"char":"Navigator:","dialogue":"Hmm... I think I\'ve heard Vice mentioned about it."},{"char":"Yumi:","dialogue":"Philyshy and I hid in an abandoned warehouse..."},{"char":"Yumi:","dialogue":"It was a warehouse that stored cheese..."},{"char":"Yumi:","dialogue":"There was nothing else to eat, so..."},{"char":"Navigator:","dialogue":"(I think I know the reason now)"},{"char":"Yumi:","dialogue":"Cheese, cheese—"},{"char":"Yumi:","dialogue":"It was cheese every day... crumbled cheese, cheese sticks, cheese slices, cheese cubes..."},{"char":"Yumi:","dialogue":"Cheese for breakfast, cheese for lunch, cheese for dinner, cheese for snacks, cheese even in our dreams..."},{"char":"Navigator:","dialogue":"I understand now..."},{"char":"Yumi:","dialogue":"So both of us are helpless when it comes to cheese..."},{"char":"Navigator:","dialogue":"I... I got it."},{"char":"Yumi:","dialogue":"Ah, I\'m so tired..."},{"char":"Navigator:","dialogue":"You are going to sleep?"},{"char":"Yumi:","dialogue":"Yea... this dried fish packet... pass it to her..."},{"char":"Yumi:","dialogue":"And... when Philyshy... returns, don\'t mention... that you saw cheese..."}],"branch":[{"text":"Naturally.","link":"1"},{"text":"Once you\'ve fallen asleep, I\'ll take her and leave.","link":"2"}]},{"chat":[{"char":"Yumi:","dialogue":"Okay... I\'m going to sleep now..."},{"char":"Yumi:","dialogue":"Remember to hide it from Philyshy... leave this room... otherwise... cheese... quickly..."},{"char":"Navigator:","dialogue":"I got it."},{"char":"Philyshy:","dialogue":"Did I fall asleep? This is... the corridor?"},{"char":"Philyshy:","dialogue":"I remember I was eating dried fish..."},{"char":"Philyshy:","dialogue":"Then I saw something... chee—"},{"char":"Navigator:","dialogue":"It was milk!"},{"char":"Navigator:","dialogue":"(Since I\'ve already promised Yumi, I can\'t mess this up.)"},{"char":"Philyshy:","dialogue":"This doesn\'t smell like milk... it\'s a love-and-hate feeling..."},{"char":"Philyshy:","dialogue":"You are blushing! It\'s not OK to lie! After all, I\'m the Intel Chief of Illumina Federation!"},{"char":"Navigator:","dialogue":"I\'m not lying! I was happy to see you eat dried fish, then I drank some milk... and accidentally spilled some on my sleeve."},{"char":"Navigator:","dialogue":"Oh yea, this packet of dried fish, take it."},{"char":"Philyshy:","dialogue":"I\'ll believe you... since you are giving me so much dried fish."},{"char":"Philyshy:","dialogue":"I\'m going back to my living quarters!"},{"char":"Navigator:","dialogue":"Whew. So close. Some cheese got on my sleeve, luckily I fooled her..."},{"char":"Navigator:","dialogue":"Oh yea, I forgot to check how much dried fish is left!"},{"char":"Navigator:","dialogue":"Wait—"},{"char":"Navigator:","dialogue":"Was that the last packet..."}],"branch":[{"text":"Restart Story","link":"0"}]},{"chat":[{"char":"Yumi:","dialogue":"Great... You\'re so sweet... she\'s so lucky... hurry..."},{"char":"Navigator:","dialogue":"Enjoy your sleep."},{"char":"Philyshy:","dialogue":"Did I fall asleep? This is... the corridor?"},{"char":"Philyshy:","dialogue":"I remember I was eating dried fish..."},{"char":"Philyshy:","dialogue":"Then I saw something... chee—"},{"char":"Navigator:","dialogue":"It was milk!"},{"char":"Navigator:","dialogue":"(Since I\'ve already promised Yumi, I can\'t mess this up.)"},{"char":"Philyshy:","dialogue":"This doesn\'t smell like milk... it\'s a love-and-hate feeling..."},{"char":"Philyshy:","dialogue":"You are blushing! It\'s not OK to lie! After all, I\'m the Intel Chief of Illumina Federation!"},{"char":"Navigator:","dialogue":"I\'m not lying! I was happy to see you eat dried fish, then I drank some milk... and accidentally spilled some on my sleeve."},{"char":"Navigator:","dialogue":"Oh yea, this packet of dried fish, take it."},{"char":"Philyshy:","dialogue":"I\'ll believe you... since you are giving me so much dried fish."},{"char":"Philyshy:","dialogue":"I\'m going back to my living quarters!"},{"char":"Navigator:","dialogue":"Whew. So close. Some cheese got on my sleeve, luckily I fooled her..."},{"char":"Navigator:","dialogue":"Oh yea, I forgot to check how much dried fish is left!"},{"char":"Navigator:","dialogue":"Wait—"},{"char":"Navigator:","dialogue":"Was that the last packet..."}],"branch":[{"text":"Restart Story","link":"0"}]}]}')}}]);
